import React from "react";
import "./subscription_block.css";
import Feature from "../features/Feature.js";

const FeatureList = ({ features = [] }) => {
  return (
    <div className="sub_block-feature_list">
      {features.map((feature, index) => (
        <Feature key={index} feature_description={feature.description} />
      ))}
    </div>
  );
};

const SubBlock = ({ partnership }) => {
  return (
    <div className="sub_block">
      <div className="sub_block-pricing_info">
        <div className="sub_block-pricing_amount">
          <p className="sub_block-pricing_amount-symbol">$</p>
          <p className="sub_block-pricing_amount-number">
            {partnership.amount}
          </p>
          <p className="sub_block-pricing_amount-annotation">per month</p>
        </div>
        <p>{partnership.subscription_description}</p>
      </div>
      <FeatureList features={partnership.features} />
      <button className="sub_block-join_button">Join</button>
    </div>
  );
};

export default SubBlock;
